define('text!views/areas/browse.html',[],function () { return '<div class="row">\r\n    <div class="large-12 columns">\r\n        <h4 class="view-heading">AREAS</h4>\r\n\r\n        <p>\r\n            <a data-bind="fastlink: \'/#/areas/create\'">Create a new area</a>\r\n        </p>\r\n\r\n        <div class="row collapse">\r\n            <div class="large-12 columns">\r\n                <table class="bumped">\r\n                    <thead>\r\n                        <tr>\r\n                            <th>Areas</th>\r\n                            <th class="right" data-bind="fastbutton: toggleRemoveItems">\r\n                                <i data-bind="css: removeItems() ? \'fi-x\' : \'fi-trash\'"></i>\r\n                            </th>\r\n                        </tr>\r\n                    </thead>\r\n                    <tbody data-bind="foreach: items">\r\n                        <tr>\r\n                            <td colspan="2">\r\n                                <a data-bind="fastbutton: $parent.selectItem">\r\n                                    <span data-bind="text: Name"></span>\r\n                                    <span class="right" data-bind="ifnot: $parent.removeItems">&#62</span>\r\n                                    <span class="right" data-bind="if: $parent.removeItems">\r\n                                        <i class="fi-trash"></i>\r\n                                    </span>\r\n                                </a>\r\n                            </td>\r\n                        </tr>\r\n                    </tbody>\r\n                </table>\r\n            </div>\r\n        </div>\r\n        <p class="error-message" data-bind="text: error"></p>\r\n    </div>\r\n</div>\r\n';});


