define('text!views/funds/browse.html',[],function () { return '<div class="row">\r\n    <div class="large-12 columns">\r\n        <h4 class="view-heading">FUNDS</h4>\r\n\r\n        <div class="row">\r\n            <div class="large-12 columns">\r\n                <a data-bind="click: navigateToCreateView">Create a new fund</a>\r\n            </div>\r\n        </div>\r\n\r\n        <p class="error-message" data-bind="if: error, text: error"></p>\r\n\r\n        <div class="row">\r\n            <div class="large-4 columns">\r\n                <label for="Area">\r\n                    Requesting area\r\n                </label>\r\n                <select name="Area" data-bind="foreach: areas, value: selectedAreaId">\r\n                    <option data-bind="attr: { value: Id }, text: Name"></option>\r\n                </select>\r\n            </div>\r\n        </div>\r\n\r\n        <div class="row">\r\n            <div class="large-12 columns">\r\n                <table class="tabular" data-bind="visible: !noItemsToShow()">\r\n                    <thead>\r\n                        <tr>\r\n                            <th data-bind="click: sort.bind($data, \'Number\')">\r\n                                Fund number</th>\r\n                            <th data-bind="click: sort.bind($data, \'Title\')">\r\n                                Title</th>\r\n                            <th class="hide-for-medium-down" data-bind="click: sort.bind($data, \'ResponsiblePerson\')">\r\n                                Responsible person</th>\r\n                            <th class="hide-for-medium-down" data-bind="click: sort.bind($data, \'CurrentBudget\')">\r\n                                Current fiscal year approved budget</th>\r\n                            <th class="hide-for-medium-down" data-bind="click: sort.bind($data, \'ProjectedExpenditures\')">\r\n                                Current fiscal year projected expenditures</th>\r\n                            <th class="hide-for-medium-down" data-bind="click: sort.bind($data, \'requestedBudget\')">\r\n                                Requested budget</th>\r\n                            <th class="hide-for-medium-down" data-bind="click: sort.bind($data, \'variance\')">\r\n                                Variance</th>\r\n                            <th class="hide-for-medium-down" data-bind="click: sort.bind($data, \'Status\')">\r\n                                Status</th>\r\n                            <th class="default-cursor hide-for-medium-down">Attachments</th>\r\n                        </tr>\r\n                    </thead>\r\n                    <tbody data-bind="foreach: items">\r\n                        <tr>\r\n                            <td>\r\n                                <a data-bind="fastlink: \'#/funds/edit/\' + Id, text: Number"></a>\r\n                            </td>\r\n                            <td data-bind="text: Title"></td>\r\n                            <td class="hide-for-medium-down" data-bind="text: ResponsiblePerson"></td>\r\n                            <td class="hide-for-medium-down" data-bind="text: formattedCurrentBudget, css: { \'negative-value\': CurrentBudget() < 0 }"></td>\r\n                            <td class="hide-for-medium-down" data-bind="text: formattedProjectedExpenditures, css: { \'negative-value\': ProjectedExpenditures() < 0 }"></td>\r\n                            <td class="hide-for-medium-down" data-bind="text: formattedRequestedBudget, css: { \'negative-value\': requestedBudget() < 0 }"></td>\r\n                            <td class="hide-for-medium-down" data-bind="text: formattedVariance, css: { \'negative-value\': variance() < 0 }"></td>\r\n                            <td class="hide-for-medium-down" data-bind="text: fundStatusText"></td>\r\n                            <td class="text-center hide-for-medium-down" data-bind="foreach: FileUploads">\r\n                                <i class="fi-paperclip"></i>\r\n                            </td>\r\n                        </tr>\r\n                    </tbody>\r\n                </table>\r\n            </div>\r\n        </div>\r\n\r\n        <p data-bind="if: noItemsToShow">No records</p>\r\n    </div>\r\n</div>\r\n';});


