define('text!views/funds/manage.html',[],function () { return '<div class="row">\r\n    <div class="large-12 columns">\r\n        <h4 class="view-heading">MANAGE FUNDS</h4>\r\n\r\n        <p class="error-message" data-bind="if: error, text: error"></p>\r\n\r\n        <div class="row">\r\n            <div class="large-4 columns">\r\n                <label for="Area">\r\n                    Requesting area\r\n                </label>\r\n                <select name="Area" data-bind="foreach: areas, value: selectedAreaId">\r\n                    <option data-bind="attr: { value: Id }, text: Name"></option>\r\n                </select>\r\n            </div>\r\n        </div>\r\n\r\n        <div class="row">\r\n            <div class="large-12 columns">\r\n                <table class="bumped" data-bind="visible: !noItemsToShow()">\r\n                    <thead>\r\n                        <tr>\r\n                            <th>Fund number</th>\r\n                            <th>Title</th>\r\n                            <th class="right" data-bind="fastbutton: deleteSelectedItems">\r\n                                <i class="fi-trash medium"></i>\r\n                            </th>\r\n                        </tr>\r\n                    </thead>\r\n                    <tbody data-bind="foreach: items">\r\n                        <tr data-bind="css: { \'destroy-item\': destroy }">\r\n                            <td>\r\n                                <a data-bind="fastbutton: $root.selectItem">\r\n                                    <span data-bind="text: Number"></span>\r\n                                </a>\r\n                            </td>\r\n                            <td colspan="2">\r\n                                <a data-bind="fastbutton: $root.selectItem">\r\n                                    <span data-bind="text: Title"></span>\r\n                                </a>\r\n                            </td>\r\n                        </tr>\r\n                    </tbody>\r\n                </table>\r\n            </div>\r\n        </div>\r\n\r\n        <p data-bind="if: noItemsToShow">No records</p>\r\n    </div>\r\n</div>\r\n';});


define('text!views/reports/funding-request.html',[],function () { return '<div class="row">\r\n    <div class="large-12 columns">\r\n        <h4 class="view-heading">FUNDING REQUEST REPORT</h4>\r\n\r\n        <div class="row">\r\n            <div class="large-12 columns">\r\n                <p>\r\n                    <a href="/reportfile/fundingrequest">Download Excel version</a>\r\n                </p>\r\n            </div>\r\n        </div>\r\n\r\n        <div class="row">\r\n            <div class="large-12 columns">\r\n                <table class="tabular">\r\n                    <thead>\r\n                        <tr>\r\n                            <th class="hide-for-small" data-bind="click: sort.bind($data, \'Number\')">\r\n                                Fund number</th>\r\n                            <th data-bind="click: sort.bind($data, \'Title\')">\r\n                                Title</th>\r\n                            <th class="hide-for-small" data-bind="click: sort.bind($data, \'ResponsiblePerson\')">\r\n                                Responsible person</th>\r\n                            <th class="hide-for-small" data-bind="click: sort.bind($data, \'CurrentBudget\')">\r\n                                Current fiscal year approved budget</th>\r\n                            <th class="hide-for-medium-down" data-bind="click: sort.bind($data, \'ProjectedExpenditures\')">\r\n                                Current fiscal year projected expenditures\r\n                            </th>\r\n                            <th data-bind="click: sort.bind($data, \'requestedBudget\')">\r\n                                Requested budget</th>\r\n                            <th class="hide-for-small" data-bind="click: sort.bind($data, \'variance\')">\r\n                                Variance</th>\r\n                        </tr>\r\n                    </thead>\r\n                    <!-- ko foreach: items -->\r\n                    <tbody data-bind="ifnot: Number() === \'O\'">\r\n                        <tr>\r\n                            <td colspan="7" class="text-center" data-bind="text: Name"></td>\r\n                        </tr>\r\n                        <!-- ko foreach: funds -->\r\n                        <tr>\r\n                            <td class="hide-for-small" data-bind="text: Number"></td>\r\n                            <td data-bind="text: Title"></td>\r\n                            <td class="hide-for-small" data-bind="text: ResponsiblePerson"></td>\r\n                            <td class="hide-for-small" data-bind="text: formattedCurrentBudget, css: { \'negative-value\': CurrentBudget() < 0 }"></td>\r\n                            <td class="hide-for-medium-down" data-bind="text: formattedProjectedExpenditures, css: { \'negative-value\': ProjectedExpenditures() < 0 }"></td>\r\n                            <td data-bind="text: formattedRequestedBudget, css: { \'negative-value\': requestedBudget() < 0 }"></td>\r\n                            <td class="hide-for-small" data-bind="text: formattedVariance, css: { \'negative-value\': variance() < 0 }"></td>\r\n                        </tr>\r\n                        <!--/ko-->\r\n                    </tbody>\r\n                    <tbody class="hide-for-small" data-bind="ifnot: Number() === \'O\'">\r\n                        <tr class="subtotal" data-bind="with: subtotals">\r\n                            <td colspan="3" data-bind="text: \'Total for \' + $parent.Name()"></td>\r\n                            <td data-bind="text: formattedCurrentBudget, css: { \'negative-value\': currentBudget() < 0 }"></td>\r\n                            <td class="hide-for-medium-down" data-bind="text: formattedProjectedExpenditures, css: { \'negative-value\': projectedExpenditures() < 0 }"></td>\r\n                            <td data-bind="text: formattedRequestedBudget, css: { \'negative-value\': requestedBudget() < 0 }"></td>\r\n                            <td data-bind="text: formattedVariance, css: { \'negative-value\': variance() < 0 }"></td>\r\n                        </tr>\r\n                    </tbody>\r\n                    <!--/ko-->\r\n                    <tbody class="hide-for-small">\r\n                        <tr class="grandtotal" data-bind="with: grandTotals">\r\n                            <td colspan="3">Grand totals</td>\r\n                            <td data-bind="text: formattedCurrentBudget, css: { \'negative-value\': currentBudget() < 0 }"></td>\r\n                            <td class="hide-for-medium-down" data-bind="text: formattedProjectedExpenditures, css: { \'negative-value\': projectedExpenditures() < 0 }"></td>\r\n                            <td data-bind="text: formattedRequestedBudget, css: { \'negative-value\': requestedBudget() < 0 }"></td>\r\n                            <td data-bind="text: formattedVariance, css: { \'negative-value\': variance() < 0 }"></td>\r\n                        </tr>\r\n                    </tbody>\r\n                    <!-- ko foreach: items -->\r\n                    <tbody data-bind="if: Number() === \'O\'">\r\n                        <tr>\r\n                            <td colspan="7" class="text-center" data-bind="text: Name"></td>\r\n                        </tr>\r\n                        <!-- ko foreach: funds -->\r\n                        <tr>\r\n                            <td class="hide-for-small" data-bind="text: Number"></td>\r\n                            <td data-bind="text: Title"></td>\r\n                            <td class="hide-for-small" data-bind="text: ResponsiblePerson"></td>\r\n                            <td class="hide-for-small" data-bind="text: formattedCurrentBudget, css: { \'negative-value\': CurrentBudget() < 0 }"></td>\r\n                            <td class="hide-for-medium-down" data-bind="text: formattedProjectedExpenditures, css: { \'negative-value\': ProjectedExpenditures() < 0 }"></td>\r\n                            <td data-bind="text: formattedRequestedBudget, css: { \'negative-value\': requestedBudget() < 0 }"></td>\r\n                            <td class="hide-for-small" data-bind="text: formattedVariance, css: { \'negative-value\': variance() < 0 }"></td>\r\n                        </tr>\r\n                        <!--/ko-->\r\n                    </tbody>\r\n                    <tbody class="hide-for-small" data-bind="if: Number() === \'O\'">\r\n                        <tr class="subtotal" data-bind="with: subtotals">\r\n                            <td colspan="3" data-bind="text: \'Total for \' + $parent.Name()"></td>\r\n                            <td data-bind="text: formattedCurrentBudget, css: { \'negative-value\': currentBudget() < 0 }"></td>\r\n                            <td class="hide-for-medium-down" data-bind="text: formattedProjectedExpenditures, css: { \'negative-value\': projectedExpenditures() < 0 }"></td>\r\n                            <td data-bind="text: formattedRequestedBudget, css: { \'negative-value\': requestedBudget() < 0 }"></td>\r\n                            <td data-bind="text: formattedVariance, css: { \'negative-value\': variance() < 0 }"></td>\r\n                        </tr>\r\n                    </tbody>\r\n                    <!--/ko-->\r\n                </table>\r\n            </div>\r\n        </div>\r\n    </div>\r\n</div>\r\n\r\n';});


define('text!views/reports/narrative.html',[],function () { return '<div class="row">\r\n    <div class="large-12 columns">\r\n        <h4 class="view-heading">NARRATIVE REPORT</h4>\r\n\r\n        <!-- ko foreach: items -->\r\n        <fieldset>\r\n            <h5 data-bind="text: Name"></h5>\r\n\r\n            <!-- ko foreach: funds -->\r\n            <div class="row">\r\n                <div class="large-12 columns">\r\n                    <div class="panel">\r\n                        <p>\r\n                            <strong data-bind="text: Title"></strong><span data-bind="    text: \' (\' + Number() + \')\'"></span>\r\n                        </p>\r\n\r\n                        <p data-bind="text: Description"></p>\r\n\r\n                        <div class="mild-callout panel" data-bind="visible: variance() !== 0">\r\n                            <p>\r\n                                <strong>Variance: </strong><span\r\n                                    data-bind="text: formattedVariance, css: { \'negative-value\': variance() < 0 }"></span>\r\n                            </p>\r\n\r\n                            <p data-bind="text: BudgetAdjustmentNote"></p>\r\n                        </div>\r\n                    </div>\r\n                </div>\r\n            </div>\r\n            <!--/ko-->\r\n\r\n            <p data-bind="if: funds().length === 0">No records</p>\r\n        </fieldset>\r\n        <!--/ko-->\r\n    </div>\r\n</div>\r\n';});


define('text!views/shared/_area-input.html',[],function () { return '<div class="row">\r\n    <div class="large-12 columns">\r\n        <section data-bind="with: item">\r\n            <h4 class="view-heading">AREA INFORMATION</h4>\r\n\r\n            <fieldset>\r\n                <h5>Details</h5>\r\n\r\n                <div class="row">\r\n                    <div class="large-4 columns">\r\n                        <label for="Number">\r\n                            Number<span class="required">*</span>\r\n                        </label>\r\n                        <input name="Number" type="text" data-bind="value: Number" />\r\n                        <label for="Number"\r\n                            class="error-message" data-bind="validationMessage: Number"></label>\r\n                    </div>\r\n                </div>\r\n\r\n                <div class="row">\r\n                    <div class="large-6 columns">\r\n                        <label for="Name">\r\n                            Name<span class="required">*</span>\r\n                        </label>\r\n                        <input name="Name" type="text" data-bind="value: Name" />\r\n                        <label for="Name"\r\n                            class="error-message" data-bind="validationMessage: Name"></label>\r\n                    </div>\r\n                </div>\r\n            </fieldset>\r\n\r\n            <div class="row">\r\n                <div class="large-12 columns">\r\n                    <p>\r\n                        <span class="text-button" data-bind="click: $parent.saveItem">\r\n                            Save\r\n                        </span>\r\n                    </p>\r\n                </div>\r\n            </div>\r\n        </section>\r\n    </div>\r\n</div>';});


define('text!views/shared/_fund-input.html',[],function () { return '<div class="row">\r\n    <div class="large-12 columns">\r\n        <section data-bind="with: item">\r\n            <h4 class="view-heading">FUND INFORMATION</h4>\r\n\r\n            <fieldset>\r\n                <h5>Current status</h5>\r\n\r\n                <div class="row hide-on-print">\r\n                    <div class="large-4 columns">\r\n                        <label for="Status">\r\n                            Status\r\n                        </label>\r\n                        <select name="Status" data-bind="value: Status">\r\n                            <option value="1">Draft</option>\r\n                            <option value="2">Final</option>\r\n                        </select>\r\n                    </div>\r\n                </div>\r\n\r\n                <div class="row">\r\n                    <div class="large-4 columns">\r\n                        <label for="Number" class="hide-on-print">\r\n                            Fund number<span class="required">*</span>\r\n                        </label>\r\n                        <input name="Number" type="text" class="hide-on-print" data-bind="value: Number, css: { validationElement: true }" />\r\n                        <p class="print-only">\r\n                            <span class="text-underline">Fund number</span>: <span data-bind="text: Number"></span>\r\n                        </p>\r\n                        <label for="Number" class="error-message" data-bind="validationMessage: Number"></label>\r\n                    </div>\r\n                </div>\r\n\r\n                <div class="row">\r\n                    <div class="large-8 columns">\r\n                        <label for="Title" class="hide-on-print">\r\n                            Title<span class="required">*</span>\r\n                        </label>\r\n                        <input name="Title" type="text" class="hide-on-print" data-bind="value: Title" />\r\n                        <p class="print-only">\r\n                            <span class="text-underline">Title</span>: <span data-bind="text: Title"></span>\r\n                        </p>\r\n                        <label for="Title" class="error-message" data-bind="validationMessage: Title"></label>\r\n                    </div>\r\n                </div>\r\n\r\n                <div class="row">\r\n                    <div class="large-6 columns">\r\n                        <label for="ResponsiblePerson" class="hide-on-print">\r\n                            Responsible person<span class="required">*</span>\r\n                        </label>\r\n                        <input name="ResponsiblePerson" type="text" class="hide-on-print" data-bind="value: ResponsiblePerson" />\r\n                        <p class="print-only">\r\n                            <span class="text-underline">Responsible person</span>: <span data-bind="text: ResponsiblePerson"></span>\r\n                        </p>\r\n                        <label for="ResponsiblePerson"\r\n                            class="error-message" data-bind="validationMessage: ResponsiblePerson">\r\n                        </label>\r\n                    </div>\r\n                </div>\r\n\r\n                <div class="row">\r\n                    <div class="large-6 columns">\r\n                        <label for="CurrentBudget" class="hide-on-print">\r\n                            Current fiscal year approved budget<span class="required">*</span>\r\n                        </label>\r\n                        <input name="CurrentBudget" type="text" class="hide-on-print"\r\n                            data-bind="value: formattedCurrentBudget, css: { \'negative-value\': CurrentBudget() < 0 }" />\r\n                        <p class="print-only">\r\n                            <span class="text-underline">Current fiscal year approved budget</span>: <span data-bind="text: formattedCurrentBudget"></span>\r\n                        </p>\r\n                        <label for="CurrentBudget"\r\n                            class="error-message" data-bind="validationMessage: CurrentBudget">\r\n                        </label>\r\n                    </div>\r\n                </div>\r\n\r\n                <div class="row">\r\n                    <div class="large-6 columns">\r\n                        <label for="ProjectedExpenditures" class="hide-on-print">\r\n                            Current fiscal year projected expenditures<span class="required">*</span>\r\n                        </label>\r\n                        <input name="ProjectedExpenditures" type="text" class="hide-on-print"\r\n                            data-bind="value: formattedProjectedExpenditures, css: { \'negative-value\': ProjectedExpenditures() < 0 }" />\r\n                        <p class="print-only">\r\n                            <span class="text-underline">Current fiscal year projected expenditures</span>: \r\n                            <span data-bind="text: formattedProjectedExpenditures"></span>\r\n                        </p>\r\n                        <label for="ProjectedExpenditures"\r\n                            class="error-message" data-bind="validationMessage: ProjectedExpenditures">\r\n                        </label>\r\n                    </div>\r\n                </div>\r\n\r\n                <div class="row">\r\n                    <div class="large-6 columns">\r\n                        <div class="input-panel hide-on-print">\r\n                            <span>Projected year-end balance:\r\n                            <strong\r\n                                data-bind="text: formattedProjectedYearEndBalance, css: { \'negative-value\': projectedYearEndBalance() < 0 }"></strong>\r\n                            </span>\r\n                        </div>\r\n                        <p class="print-only">\r\n                            <span class="text-underline">Projected year-end balance</span>: <span data-bind="text: formattedProjectedYearEndBalance"></span>\r\n                        </p>\r\n                    </div>\r\n                </div>\r\n            </fieldset>\r\n\r\n            <fieldset>\r\n                <h5>Next year projected budget</h5>\r\n\r\n                <div class="row">\r\n                    <div class="large-4 columns">\r\n                        <label for="BudgetAdjustment" class="hide-on-print">\r\n                            Projected increase or decrease<span class="required">*</span>\r\n                        </label>\r\n                        <input name="BudgetAdjustment" type="text" class="hide-on-print"\r\n                            data-bind="value: formattedBudgetAdjustment, css: { \'negative-value\': BudgetAdjustment() < 0 }" />\r\n                        <p class="print-only">\r\n                            <span class="text-underline">Projected increase or decrease</span>: <span data-bind="text: formattedBudgetAdjustment"></span>\r\n                        </p>\r\n                        <label for="BudgetAdjustment"\r\n                            class="error-message" data-bind="validationMessage: BudgetAdjustment">\r\n                        </label>\r\n                    </div>\r\n                </div>\r\n\r\n                <div class="row">\r\n                    <div class="large-6 columns">\r\n                        <div class="input-panel hide-on-print">\r\n                            <span>Requested budget: \r\n                            <strong\r\n                                data-bind="text: formattedRequestedBudget, css: { \'negative-value\': requestedBudget() < 0 }"></strong>\r\n                            </span>\r\n                        </div>\r\n                        <p class="print-only">\r\n                            <span class="text-underline">Requested budget</span>: <span data-bind="text: formattedRequestedBudget"></span>\r\n                        </p>\r\n                    </div>\r\n                </div>\r\n            </fieldset>\r\n\r\n            <fieldset>\r\n                <h5>Supporting information</h5>\r\n\r\n                <div class="row">\r\n                    <div class="large-12 columns">\r\n                        <label for="Description" class="hide-on-print">\r\n                            Brief description of the program and types of expenses paid for by this fund<span class="required">*</span>\r\n                        </label>\r\n                        <textarea name="Description" class="hide-on-print"\r\n                            data-bind="value: Description"></textarea>\r\n                        <p class="print-only">\r\n                            <span class="text-underline">Brief description of the program and types of expenses paid for by this fund</span>\r\n                        </p>\r\n                        <p class="print-only" data-bind="text: Description"></p>\r\n                        <label for="Description"\r\n                            class="error-message" data-bind="validationMessage: Description">\r\n                        </label>\r\n                    </div>\r\n                </div>\r\n\r\n                <div class="row">\r\n                    <div class="large-12 columns">\r\n                        <label for="BudgetAdjustmentNote" class="hide-on-print">\r\n                            Reason for increase or decrease in the requested budget for this fund<span class="required"\r\n                                data-bind="visible: BudgetAdjustment() > 0">*</span>\r\n                        </label>\r\n                        <textarea name="BudgetAdjustmentNote" class="hide-on-print"\r\n                            data-bind="value: BudgetAdjustmentNote"></textarea>\r\n                        <p class="hide" data-bind="css: { \'hide-on-print\': BudgetAdjustment() === 0, \'print-only\': BudgetAdjustment() > 0 }">\r\n                            <span class="text-underline">Reason for increase or decrease in the requested budget for this fund</span>\r\n                        </p>\r\n                        <p class="hide" \r\n                           data-bind="text: BudgetAdjustmentNote, css: { \'hide-on-print\': BudgetAdjustment() === 0, \'print-only\': BudgetAdjustment() > 0 }"></p>\r\n                        <label for="BudgetAdjustmentNote"\r\n                            class="error-message" data-bind="validationMessage: BudgetAdjustmentNote">\r\n                        </label>\r\n                    </div>\r\n                </div>\r\n            </fieldset>\r\n\r\n            <section data-bind="ifIsInRole:\'MANAGE-FUNDS\'">\r\n                <!-- ko  if: $parent.router.activeInstruction().fragment !== \'funds/create\' -->\r\n                <fieldset class="hide-on-print">\r\n                    <h5>Administrator comments</h5>\r\n                    <!-- TODO: Style username and date -->\r\n                    <table class="tabular">\r\n                        <tbody data-bind="foreach: $parent.comments">\r\n                            <tr>\r\n                                <td>\r\n                                    <span data-bind="text: Text() + \' by \' + UserName() + \' \'"></span>\r\n                                    <span class="time-stamp" data-bind="text: moment(DateTimeCreated).fromNow()"></span>\r\n                                </td>\r\n                            </tr>\r\n                        </tbody>\r\n                    </table>\r\n\r\n                    <div class="row" data-bind="ifnot: $parent.newComment()">\r\n                        <div class="large-12 columns">\r\n                            <a data-bind="click: $parent.initComment">Add comment</a>\r\n                        </div>\r\n                    </div>\r\n\r\n                    <div class="row" data-bind="with: $parent.newComment">\r\n                        <div class="large-9 columns">\r\n                            <textarea data-bind="value: Text"></textarea>\r\n                        </div>\r\n                        <div class="large-3 columns">\r\n                            <a class="button" data-bind="click: $parents[1].saveComment">Save comment</a>\r\n                        </div>\r\n                    </div>\r\n                </fieldset>\r\n                <!--/ko-->\r\n            </section>\r\n\r\n            <fieldset class="hide-on-print">\r\n                <h5>Attachments</h5>\r\n\r\n                <div>\r\n                    <div class="large-12 columns">\r\n                        <p>\r\n                            <a href="http://www.obfp.vt.edu/forms/foundation-portal/budget-request-template.xlsx">Download budget request template</a>\r\n                        </p>\r\n                    </div>\r\n                </div>\r\n\r\n                <form name="fileInputForm" class="hide-on-print">\r\n                    <input type="file" name="files[]" multiple\r\n                        data-bind="event: { onload: window.fileInputForm.reset(), change: $parent.postFiles }" />\r\n                </form>\r\n\r\n                <div class="row">\r\n                    <div class="large-12 columns">\r\n                        <table data-bind="visible: FileUploads().length > 0">\r\n                            <thead>\r\n                                <tr>\r\n                                    <th>File</th>\r\n                                    <th></th>\r\n                                </tr>\r\n                            </thead>\r\n                            <tbody data-bind="foreach: FileUploads">\r\n                                <tr data-bind="visible: !destroy()">\r\n                                    <td>\r\n                                        <a data-bind="visible: Id, text: OriginalFileName,\r\n    attr: { href: Source }"></a>\r\n                                        <span class="error-message"\r\n                                            data-bind="visible: errorMessage, text: errorMessage"></span>\r\n                                    </td>\r\n                                    <td data-bind="click: $root.removeFileUpload">\r\n                                        <i class="fi-trash"></i>\r\n                                    </td>\r\n                                </tr>\r\n                            </tbody>\r\n                        </table>\r\n\r\n                        <p data-bind="visible: FileUploads().length === 0">No files uploaded</p>\r\n                    </div>\r\n                </div>\r\n            </fieldset>\r\n\r\n            <div class="row" data-bind="visible: errorMessage">\r\n                <div class="large-12 columns">\r\n                    <p>\r\n                        <span class="error-message"\r\n                            data-bind="text: errorMessage"></span>\r\n                    </p>\r\n                </div>\r\n            </div>\r\n\r\n            <div class="row hide-on-print">\r\n                <div class="large-12 columns">\r\n                    <p>\r\n                        <span class="text-button" data-bind="click: $parent.saveItem">Save</span>\r\n                    </p>\r\n                </div>\r\n            </div>\r\n        </section>\r\n\r\n    </div>\r\n</div>\r\n';});


define('text!views/shared/_user-input.html',[],function () { return '<div class="row viewBackground">\r\n    <div class="large-12 columns">\r\n        <section data-bind="with: item">\r\n            <h4 class="view-heading">USER INFORMATION</h4>\r\n\r\n            <fieldset>\r\n                <h5>Details</h5>\r\n                <div class="row">\r\n                    <div class="large-12 columns">\r\n                        <label for="Pid">\r\n                            Pid<span class="required">*</span>\r\n                        </label>\r\n                        <input type="text" name="Pid" required\r\n                            data-bind="value: Pid, blurOnEnter: true" />\r\n                        <label for="Pid" class="error-message" data-bind="validationMessage: Pid"></label>\r\n                    </div>\r\n                </div>\r\n            </fieldset>\r\n\r\n            <fieldset>\r\n                <h5>Fund roles</h5>\r\n\r\n                <div class="row">\r\n                    <div class="large-4 columns">\r\n                        <label>\r\n                            <input type="checkbox" name="Roles" value="EDIT-O" data-bind="checked: Roles" />\r\n                            Edit Other Uses of Funds\r\n                        </label>\r\n                    </div>\r\n\r\n                    <div class="large-4 columns">\r\n                        <label>\r\n                            <input type="checkbox" name="Roles" value="EDIT-S27" data-bind="checked: Roles" />\r\n                            Edit President\r\n                        </label>\r\n                    </div>\r\n\r\n                    <div class="large-4 columns">\r\n                        <label>\r\n                            <input type="checkbox" name="Roles" value="EDIT-S26" data-bind="checked: Roles" />\r\n                            Edit Senior Vice President & Provost\r\n                        </label>\r\n                    </div>\r\n                </div>\r\n\r\n                <div class="row">\r\n                    <div class="large-4 columns">\r\n                        <label>\r\n                            <input type="checkbox" name="Roles" value="EDIT-S41" data-bind="checked: Roles" />\r\n                            Edit Vice President for Development & University Relations\r\n                        </label>\r\n                    </div>\r\n\r\n                    <div class="large-4 columns">\r\n                        <label>\r\n                            <input type="checkbox" name="Roles" value="EDIT-S46" data-bind="checked: Roles" />\r\n                            Edit Vice President for Finance & CFO                           \r\n                        </label>\r\n                    </div>\r\n\r\n                    <div class="large-4 columns">\r\n                    </div>\r\n                </div>\r\n            </fieldset>\r\n\r\n            <fieldset>\r\n                <h5>Administrator roles</h5>\r\n\r\n                <div class="row">\r\n                    <div class="large-4 columns">\r\n                        <label>\r\n                            <input type="checkbox" name="Roles" value="MANAGE-FUNDS" data-bind="checked: Roles" />\r\n                            Manage funds\r\n                        </label>\r\n                    </div>\r\n\r\n                    <div class="large-4 columns">\r\n                        <label>\r\n                            <input type="checkbox" name="Roles" value="MANAGE-USERS" data-bind="checked: Roles" />\r\n                            Manage users\r\n                        </label>\r\n                    </div>\r\n\r\n                    <div class="large-4 columns">\r\n                        <label>\r\n                            <input type="checkbox" name="Roles" value="MANAGE-AREAS" data-bind="checked: Roles" />\r\n                            Manage areas\r\n                        </label>\r\n                    </div>\r\n                </div>\r\n            </fieldset>\r\n\r\n            <div class="row" data-bind="visible: errorMessage">\r\n                <div class="large-12 columns">\r\n                    <p>\r\n                        <span class="error-message"\r\n                            data-bind="text: errorMessage"></span>\r\n                    </p>\r\n                </div>\r\n            </div>\r\n\r\n            <div class="row">\r\n                <div class="large-12 columns">\r\n                    <p>\r\n                        <span class="text-button" data-bind="click: $parent.saveItem">\r\n                            Save\r\n                        </span>\r\n                    </p>\r\n                </div>\r\n            </div>\r\n        </section>\r\n    </div>\r\n</div>\r\n';});


//define('text!views/shell.html',[],function () { return '<div class="contain-to-grid hide-on-print">\r\n    <nav class="top-bar">\r\n        <ul class="title-area">\r\n            <!-- Title Area -->\r\n            <li class="name">\r\n                <!-- Leave this empty -->\r\n            </li>\r\n            <!-- Remove the class "menu-icon" to get rid of menu icon. Take out "Menu" to just have icon alone -->\r\n            <li class="toggle-topbar menu-icon"><a href="#"><span></span></a></li>\r\n        </ul>\r\n\r\n        <section class="top-bar-section">\r\n            <ul class="right">\r\n                <li data-bind="ifNotIsInRole: \'MANAGE-FUNDS\'"><a href="/#/funds/browse">Funds</a></li>\r\n                <li data-bind="ifIsInRole: \'MANAGE-FUNDS\'" class="has-dropdown">\r\n                    <a>Funds</a>\r\n                    <ul class="dropdown">\r\n                        <li><a href="/#/funds/browse">Browse</a></li>\r\n                        <li><a href="/#/funds/manage">Manage</a></li>\r\n                    </ul>\r\n                </li>\r\n                <li class="has-dropdown">\r\n                    <a>Reports</a>\r\n                    <ul class="dropdown">\r\n                        <li><a href="/#/reports/funding-request">Funding Request</a></li>\r\n                        <li><a href="/#/reports/narrative">Narrative</a></li>\r\n                    </ul>\r\n                </li>\r\n                <li data-bind="ifIsInRole: \'MANAGE-USERS\'"><a href="/#/users/browse">Users</a></li>\r\n                <li data-bind="ifIsInRole: \'MANAGE-AREAS\'"><a href="/#/areas/browse">Areas</a></li>\r\n                <li><a href="/home/logout">Logout</a></li>\r\n            </ul>\r\n        </section>\r\n    </nav>\r\n</div>\r\n\r\n<div class="row view-background">\r\n    <div class="large-12 columns">\r\n        <h1 class="app-heading hide-on-print">Foundation<span>Portal</span></h1>\r\n\r\n        <section id="content" data-bind="router: { transition: \'scrollers\', cacheViews: true }">\r\n        </section>\r\n\r\n        <div id="timeoutModal" class="small reveal-modal" data-options="closeOnBackgroundClick: false">\r\n            <h4>Your session is about to timeout.</h4>\r\n            <p>\r\n                You will be logged out in <span class="counter"></span> seconds. Click continue to\r\n                extend your session.\r\n            </p>\r\n\r\n            <span class="text-button button-close-reveal-modal">Continue</span>\r\n\r\n            <a class="close-reveal-modal">&#215;</a>\r\n        </div>\r\n    </div>\r\n</div>\r\n';});


define('text!views/users/browse.html',[],function () { return '<div class="row collapse">\r\n    <div class="large-12 columns">\r\n        <h4 class="view-heading">USERS</h4>\r\n\r\n        <p>\r\n            <a data-bind="fastlink: \'/#/users/create\'">Create a new user</a>\r\n        </p>\r\n\r\n        <p class="error-message" data-bind="if: error, text: error"></p>\r\n\r\n        <table class="bumped" data-bind="visible: !noItemsToShow()">\r\n            <thead>\r\n                <tr>\r\n                    <th>Users</th>\r\n                    <th class="right" data-bind="fastbutton: toggleRemoveItems">\r\n                        <i data-bind="css: removeItems() ? \'fi-x\' : \'fi-trash\'"></i>\r\n                    </th>\r\n                </tr>\r\n            </thead>\r\n            <tbody data-bind="foreach: items">\r\n                <tr>\r\n                    <td colspan="2">\r\n                        <a data-bind="fastbutton: $parent.selectItem">\r\n                            <span data-bind="text: Pid"></span>\r\n                            <span class="right" data-bind="ifnot: $parent.removeItems">&#62</span>\r\n                            <span class="right" data-bind="if: $parent.removeItems">\r\n                                <i class="fi-trash"></i>\r\n                            </span>\r\n                        </a>\r\n                    </td>\r\n                </tr>\r\n            </tbody>\r\n        </table>\r\n\r\n        <p data-bind="if: noItemsToShow">No records</p>\r\n    </div>\r\n</div>\r\n';});


